class Day05Solver < SolverBase
  #
  def call
    react(input)
  end

  def call2
    ('a'..'z').map do |unit|
      react(input.gsub(/#{unit}/i, '')).size
    end.min
  end

  private

  def react(polymer)
    loop do
      old_size = polymer.size
      polymer = react_regexs.reduce(polymer) do |p, regex|
        p.gsub(regex, '')
      end

      return polymer if polymer.size == old_size
    end
  end

  def react_regexs
    @react_regexs ||= ('a'..'z').map do |unit|
      /#{unit}#{unit.upcase}|#{unit.upcase}#{unit}/
    end
  end

  public

  def self.raw_input
    ''
  end
end
